import React, { useEffect, useState } from 'react';
import axios from 'axios';
import base_url from '../../api/bootapi';
import { Button } from 'react-bootstrap';

const List=()=>{


const [workData, setWorkData]=useState();   



useEffect(()=>{
    axios.get(`${base_url}/user/workDetails/`).then((res)=>{
        console.log(res.data);
        setWorkData(res.data);
    });
},[]);


return <div>{
                !workData ? ("No Work Found") : (
                    <table className="table table-bordered table-success">
                        <thead className="table-dark">
                            <tr>
                                <th>Salary</th>
                                <th>Work</th>
                                <th>Location</th>
                                <th>Work Type</th>
                            </tr>
                        </thead>
                        <tbody className="table-active">
                            {
                                workData.map((workDescription, index)=>(
                                    <tr key={index}>
                                        <td>{workDescription.workAmount}</td>
                                        <td>{workDescription.description}</td>
                                        <td>{workDescription.location}</td>
                                        <td>{workDescription.category}</td>
                                    </tr>
                                ))
                            }
                        </tbody>
                    </table>
                )
            }
            {/* <nav className="d-flex justify-content-center">
                <ul className="pagination">
                    <li className="page-link">1</li>
                </ul>
            </nav> */}
            <div><p></p></div>
            <nav className="d-flex justify-content-center"><Button>ADD WORK</Button><Button className="ml-4">DELETE WORK</Button><Button className="ml-4">UPDATE WORK</Button></nav>
        </div>
    
}
export default List;
